import logo from './logo.svg';
import './App.css';

import Menu from './Menu'
import Equipos from './Equipos'

function App() {
  return (
    <div className="container">
    <Menu />

    <Equipos nombre="Real Madrid" descripcion="El Real Madrid, nombrado mejor club del siglo XX, fue fundado el 6 de marzo de 1902 y en su historia que ya acumula más de un siglo se ha convertido en uno de los clubes de fútbol más importantes del mundo, a nivel deportivo, social y económico. Sus colores blancos, su escudo y los jugadores que los han defendido forman parte de una de las más grandes leyendas del deporte mundial y uno de los clubes más populares, tanto por seguimiento de sus partidos como por número de aficionados." />
    <Equipos nombre="F.C. Barcelona"/>
    <Equipos nombre="Juventus"/>
    </div>
  );
}

export default App;
